(5875, '(((I-C)*100)/S)-((58.44*N*(V-B)*100*1.21)/(W*1000))', 'SA=(I-C)/S*100-(58.44*N*(V-B)*100)/(W*1000)*1.21\nSA=sulphated ash in % (round to two decimal place)\n I=Wi= weight after ignition in gm (four decimal places)\n C=Wc=weight of empty crucible in gm (four decimal places)\n S=Ws=weight of sample in gm (four decimal places)\nNaCl= NaCl content in %(round to two decimal place), \nV= volume of titer in ml (one decimal place)\nB=volume of blank in mL (one decimal place)\nN= strength of AgNO3 in N (four decimal places), \nW= weight of sample in gm (four decimal places)\nSS=Sodium sulphate in %\nSA(Salt free)=Sulphated Ash (salt free basis) in % (round to one decimal place)=SA-SS\nSA=(Wi-Wc)/Ws*100=(I-C)/S*100\nNaCl=(58.44*N*(V-B)*100)/(W*1000)\nSS=NaCl*1.21', 'Sulphated Ash (Salt free basis)', 'Chemical', 400, NULL, '', 585, 'Sulphated Ash (Salt free basis)', ' '),
